import React from 'react';
import { Link } from 'react-router-dom';
import AdminPanel from './Admin';

const Admin = () => {
  return (
    <div className="flex">
      {/* Sidebar with Navigation Menu */}
      <div className="w-1/4 bg-gray-800 text-white p-5">
        <h2 className="text-2xl font-bold mb-5">Admin Panel</h2>
        <ul>
          <li className="mb-4">
            <Link to="/admin/customers" className="text-lg hover:text-blue-400">Customers</Link>
          </li>
          <li className="mb-4">
            <Link to="/admin/orders" className="text-lg hover:text-blue-400">Orders</Link>
          </li>
          <li className="mb-4">
            <Link to="/admin/products" className="text-lg hover:text-blue-400">Products</Link>
          </li>
        </ul>
      </div>

      {/* Content Section */}
      <div className="w-3/4 p-5">
        <AdminPanel/>
      </div>
    </div>
  );
};

export default Admin;
